	(2, 'main page', ' this isu800 au800 sample talk. function au800 function au800 function au800 theu800 sensor signals accelerometer andu800 gyroscope were preu800-processed byu800 applying noise filters andu800 then sampled inu800 fixed-width sliding windows ofu800 2u800u82e56u800 secu800 andu800 50u800 overlap 128u800 readings window . theu800 sensor acceleration signal which hasu800 gravitational andu800 body motion components wasu800 separated using au800 butterworth lowu800-pass filter into body acceleration andu800 gravity. theu800 gravitational force isu800 assumed tou800 have only lowu800 frequency components therefore au800 filter with 0u800u82e3u800 hzu800 cutoff frequency wasu800 used. type create break nou800 bgcolor #eeeeff chu8e1bb89nh su8e1bbada lu8e1baa1i phu8e1baa7n nu8c3a0y '),
